import Role from "../models/rol.model";
import message from "../constant/message";

export const getRoles = async (req, res) => {
  try {
    const roles = await Role.find();
    return res.status(200).json({ status: true, roles });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const getRolById = async (req, res) => {
  try {
    const role = await Role.findById(req.params.id);
    res.status(200).json({ status: true, role });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const createRole = async (req, res) => {
  try {
    const role = new Role(req.body);
    await role.save();

    return res.status(200).json({ status: true, message: message.SUCCESS });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const updateRolById = async (req, res) => {
  await Role.findByIdAndUpdate(req.params.id, req.body);
  return res.status(200).json({ status: true, message: message.SUCCESS });
};

