import User from "../models/user.model";
import Role from "../models/rol.model";
import message from "../constant/message";

export const getUsers = async (req, res) => {
  try {
    User.find({}, function (err, users) {
      Role.populate(users, { path: "rol" }, function (err, users) {
        return res.status(200).json({ status: true, users });
      });
    }).select("-password");
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const getUserById = async (req, res) => {
  try {
    const user = await User.findById(req.params.id)
      .select("-password")
      .populate({
        path: "rol",
        model: Role,
      });

    res.status(200).json({ status: true, user });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const createUser = async (req, res) => {
  try {
    const user = new User(req.body);

    const isEmailExist = await User.findOne({ email: user.email });
    if (isEmailExist) {
      return res
        .status(400)
        .json({ status: false, message: message.IS_EMAIL_EXIST });
    }

    user.password = await User.encryptPassword(user.password);
    await user.save();

    return res.status(200).json({ status: true, message: message.SUCCESS });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const updateUserById = async (req, res) => {
  const user = req.body;
  await User.findByIdAndUpdate(req.params.id, {
    firstName: user.firstName,
    lastName: user.lastName,
    address: user.address,
    phone: user.phone,
    email: user.email,
    activated: user.activated,
    rol: user.rol,
    view: user.view,
    create: user.create,
    edit: user.edit,
    upload: user.upload,
    download: user.download,
  });
  return res.status(200).json({ status: true, message: message.SUCCESS });
};

