import TypologyFile from "../models/typologyFile.model";
import message from "../constant/message";

export const createTypologyFile = async (req, res) => {
  try {
    const typologieFile = new TypologyFile(req.body);
    await typologieFile.save();

    return res.status(200).json({ status: true, message: message.SUCCESS });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const getFileTypologyById = async (req, res) => {
  try {
    const typologieFile = await TypologyFile.findById(req.params.id);
    res.status(200).json({ status: true, typologieFile });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const getFilesTypologyById = async (req, res) => {
  try {
    const typologieFiles = await TypologyFile.find({ typology: req.params.id });
    res.status(200).json({ status: true, typologieFiles });
  } catch (error) {
    return res.status(500).json(error);
  }
};

export const searchFilesType = async (req, res) => {
  try {
    const typologieFiles = await TypologyFile.find({
      $or: [
        { authors: { $regex: req.body, $options: "i" } },
        { name_prodcut: { $regex: req.body, $options: "i" } },
      ],
    });
    res.status(200).json({ status: true, typologieFiles });
  } catch (error) {
    return res.status(500).json(error);
  }
};

